import React, { Component } from 'react';
import Sidebar from './component/Sidebar';
import './App.css';
import Azure from './component/azure.js';
import {Header, Layout} from "antd";
class App extends Component {
  render() {
    return (
      <div className="App">
          <Layout>
              <Sidebar></Sidebar>
              <Layout>
                  <Azure></Azure>
              </Layout>
          </Layout>
      </div>
    );
  }
}

export default App;
